import React, { useState } from 'react';
import './Sidebar.css'; // Import your CSS file if you have one
import { Dashboard } from './dashboard';

const Sidebar = () => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const handleToggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  return (
    <div className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>
      <div className="logo-details">
    
        <div className="logo_name">Drivers App</div>
        <svg xmlns="http://www.w3.org/2000/svg" width="20" height="16" fill="currentColor" class="bi bi-list" viewBox="0 0 16 16" id="btn" onClick={handleToggleSidebar}>
  <path fill-rule="evenodd" d="M2.5 12a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5m0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5m0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5"/>
</svg>
      
      </div>
      <ul className="nav-list ">
        <li>
         Home
        </li>
        <li>   
      Service
      </li>
      <li>
       
      contact
      </li>
      <li>
       
      about
      </li>

      
      </ul>
      {/* Your profile section */}
    </div>
  );
};

const DashboardSection = () => (
  <section className="home-section">
   <Dashboard/>
  </section>
);

const MainDashboard = () => (
  <div className="app-container">
    <Sidebar />
    <DashboardSection />
  </div>
);

export default MainDashboard;
